import * as React from 'react';
import Button from '@mui/material/Button';
import Grid from '@mui/material/Grid';
import Box from '@mui/material/Box';
import Typography from '@mui/material/Typography';
import Container from '@mui/material/Container';
import UserForm from './UserForm';


export default class Inference extends React.Component{
    constructor(props){
        super(props);
        this.state = {
        };
        this.handleSubmit = this.handleSubmit.bind(this);
    }

    handleSubmit(imagew, imageh, files){
        const formData = new FormData();
        formData.append("imagew", imagew);
        formData.append("imageh", imageh)
        formData.append("files", files);

        axios.post(UPLOAD_URL, formData).then((res) => {
            alert("File Upload success");
        }).catch((err) => alert("File Upload Error"));
    }


    render(){
        return(
            <Grid container spacing={2}>
            <Grid item xs={4}>
                <UserForm submitCallback={(imagew, imageh, files) => this.handleSubmit(imagew, imageh, files)}/>
            </Grid>
            <Grid item xs={8}>
                <p>Hello</p>
            </Grid>
            </Grid>
            
        );
    }
    
}
